import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  console.log('Home component rendering');
  
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Welcome to Red Valley Apartment</h1>
      <p>Comprehensive society financial management system</p>
      
      <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', marginTop: '40px' }}>
        <div style={{ padding: '20px', border: '1px solid #ccc', borderRadius: '8px' }}>
          <h2>Admin Portal</h2>
          <p>Manage society finances</p>
          <Link to="/login/admin" style={{ 
            display: 'inline-block', 
            padding: '10px 20px', 
            backgroundColor: '#6a0dad', 
            color: 'white', 
            textDecoration: 'none',
            borderRadius: '4px'
          }}>
            Admin Login
          </Link>
        </div>
        
        <div style={{ padding: '20px', border: '1px solid #ccc', borderRadius: '8px' }}>
          <h2>Member Portal</h2>
          <p>View your payments</p>
          <Link to="/login/member" style={{ 
            display: 'inline-block', 
            padding: '10px 20px', 
            backgroundColor: '#4caf50', 
            color: 'white', 
            textDecoration: 'none',
            borderRadius: '4px'
          }}>
            Member Login
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
